import { data } from "jquery"

function receiveJSON(){
    var files = []
    var test = [
        [{
            a : 1,
        }],
        [{
            a : 1,
        }]
    ]
    fetch('http://localhost:3001/receiveJSON')
    .then(res =>res.json())
    .then(data => console.log(data[0]))
    .then(data => files.concat(data))
    var a = []
    a.push(files[0])
    console.log(test)
    console.log(files)
    return files
    
}

export default receiveJSON;
